const App = () => {
  const [data, setData] = useState(null);

  useEffect(() => {
    const getData = async () => {
      const result = await fetchData();
      setData(result);
    };
    getData();
  }, []);

  return (
    <div>
      <Header />
      <div>{data ? JSON.stringify(data) : 'Loading data...'}</div>
      <Footer />
    </div>
  );
};

export default App;
